import React, {Component} from 'react';

import './Welcome.css';
import ReactDOM from 'react-dom';


class Welcome extends React.Component {
	constructor(){
        super();
        this.state={
           'assets' : []
            
        }
        
        
    }
    componentDidMount(){
        this.getAssets();
    }
    getAssets(){
        fetch('http://project.razorbee.com/signage/signage-rb/client/player/play.json')
        .then(results=>results.json())
        .then(results=>this.setState({'assets':results}));
        }
    render(){
        return(
        
        <ul>
            {this.state.assets.map(function(asset,index){
             return(
             <div>
             <p>{asset.filename}</p>
             </div>
            
             )}
            
             )}
            </ul>
        
        )
    }
}
